import React,{useState} from 'react'
import Login from "./Login";

function Main() {

    const [status, setstatus] = useState(false)

    if(status){
        return(
            <h1>Logged In</h1>
        )
    }


    return (
        <div>
            <Login setStatus={setstatus}/>
            <h1>Registration</h1>
        </div>
    )
}

export default Main
